  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108232 includes chemical,
  meteorological, physical and underway - surface data collected from EXPLORER OF
  THE SEAS in the Caribbean Sea and North Atlantic Ocean from 2012-01-27 to 2012-11-16
  and retrieved during cruise 33KF20120127 (EX1203) - 33KF20121104 (EX1240). These
  data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE,
  BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or fugacity) of carbon
  dioxide, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
  data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement. These data were collected by Rik
  Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory
  as part of the VOS Explorer of the Seas Lines 2012 data set.nnThe Global Volunteer
  Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
  Coordination Project (IOCCP). International groups from 14 countries have been outfitting
  research ships and commercial vessels with automated CO2 sampling equipment to analyze
  the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
